INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES ("", 0, "", "", "", 21, 14112029, 14112, "vo_wac_220705", 0, "vo_wac_220705_001");
INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (0.5, 10, 0, 0, 1, 11, 14112030, 14112, 105611, 1, "上出来、上出来。\nさて、絵も完成したことだし、\nみんなでパパっと片づけをして\n食事にでも行くとするかい。");
INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES ("", "", "", "", "", 91, 14112031, 14112, 0, "", "");
